601	t	2020-04-19 02:23:00	\N	Conjunto Ceará	\N	2020-04-19 02:21:00	2020-04-11 02:17:00	Neste local funciona um tipo de comércio de rua. Sem alvará, ocupando o espaço da rua. Com mesas e cadeiras. Poluindo a rua com fumaça. Onde há crianças e idosos com alergias respiratórias. Fora o desrespeito com o volume de som alto. Bastante alto por sinal. Que ultrapassam os horários que são permitidos. Muitas vezes dá 3 da madrugada e o som nas alturas. Quando minha igreja está realizando um culto, eles aumentam o som não respeitando nem a palavra de Deus. Nessa época de pandemia mundial, ao invés de estarem fazendo o isolamento social. Estão causando aglomeração, porque continua sendo colocado na rua do lado da praça de quinta a domingo . Já não aguento mais essa falta de respeito. Fora a higienização que é péssima. Vendem bebidas , aglomeram pessoas. Principalmente aqueles que bebem e urinam na rua. Por que lá não há banheiro para os clientes. Local onde se passa mulheres e crianças que vão a igreja e se deparam com homens bebos com a genital do lado de fora. Chega até ser um abuso!!! Sei que todo o mundo tem que ganhar o seu ganhar pão. Mas do modo que está acontecendo não é o certo. Estão passando dos limites. Descumprem horários, som alto. Não respeita a igreja. Ninguém é obrigado a conviver com isso. Fora que tá virando um ponto de prostituição pois mulheres que se vendem por uma bebida, ficam aos berros neste local. Com palavras de baixo escalão, com gestos feios. Se esfregando em homens. Ainda levam seus filhos! Os expondo a todo tipo de risco. Que eu saiba um local que vende bebida, não é pra andar crianças. E nesse momento difícil que todos estão passando. Deviam estar em suas casas  Isso não é um exemplo que quero pra minha comunidade. Principalmente pra crianças. Esse local descumpre tudo que é permitido por lei e política de educação, seriedade, civilidade. Se ao menos respeitassem o volume de som alto, tratassem da higiene do local e ensinassem seus clientes a não fazerem necessidades num local onde transitam pessoas. Seria um mínimo a se fazer. Pensei que o decreto do governador proibia comércio de rua ser aberto. Não vi cumprir nenhum dia! E olha que hoje já é 11/04/20. Casos de coronavirus aumentando e esses irresponsáveis colocando a vida de todo mundo em risco. Um mês já de pandemia aqui em Fortaleza e estes abençoados não respeitaram nenhum dia. Falta de respeito demais. Não vou me esconder, porque não precisa. Estou pensando no bem dos meus irmãos: não pensam na irmã Zuleine uma senhora idosa com seus 80 anos. Só pensam no próprio umbigo. Parem de ser egoístas. Pensem no próximo, na comunidade. Nos irmãos. Venha a nossa igreja quando puder. A Jerusalém estará de braço aberto. Parem de agredir a população, ninguém aguenta mais isso. Nossos finais de semana que era pra ser de louvor e adoração. Virou praticamente um inferno. Com todas essas coisas ridículas. Comida de péssima qualidade, poluição do ambiente, muita fumaça, poluição sonora , volume de som alto até a madrugada. Ninguém dorme literalmente. Nada!!!! Eu também já sou idoso e me incomoda bastante isso ... Apesar de morar em outra rua. Imagine quem mora lá perto. Se eu não aguento aqui, na 767. Imagino lá!!! Só com muita oração pra aguentar. Não pensam no perigo do vírus, não respeita a comunidade. Pensei que morava num lugar tranquilo. Mas moro dentro do pardieiro. Não tenho mais paz nos meus finais de semana. Acredito que outras pessoas também. Só que teem medo de falar. Eu não tenho medo! Me identifico e ainda convido vocês para um chá, uma conversa civilizada e ensino como respeitar um irmão , como respeitar uma comunidade. Vocês estão desrespeitando um local de paz. Virou um cabaré um local de ambiente familiar. Nunca vi isso aqui. Antes as pessoas respeitavam e respeitam o horário de volume de som. É uma comunidade que não é de gritaria. Até este ponto de rua ser botado. Não deixo meus netos nem chegarem perto deste antro de perdição. Isolamento social descumprido, muita aglomerado populacional. Tá errado isso. Muito errado!!!! Nossa comunidade merece respeito!!!!	t	-3.771135	Rua Setecentos Cinco	-38.5985	121	Praça da Fumaça/Liberdade	2004192532687	2	\N	2532686	95465	2532627	11	\N	f	\N	7480385	\N	\N	\N	\N	\N	\N	f	\N	\N	\N	0	CONJUNTO CEARÁ II	1	\N	\N	\N	\N	2020-04-20 08:20:52.587	f	\N	\N	\N	\N	\N	\N	\N	\N	2020-05-09 16:44:08.971	2527340	f	\N	\N	\N	\N	f	f	f	AO FISCAL, TOMAR AS DILIGÊNCIAS LEGAIS CABÍVEIS.	\N	\N	\N	\N	\N	f	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	100	\N	\N
