CREATE FUNCTION public.notificar_sync() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    payload JSON;
    entity_id BIGINT;
BEGIN
    -- Pega o ID da entidade (OLD para DELETE, NEW para INSERT/UPDATE)
    IF (TG_OP = 'DELETE') THEN
        entity_id = OLD.id;
    ELSE
        entity_id = NEW.id;
    END IF;

    -- Payload minimalista - evita limite de 8000 bytes
    payload = json_build_object(
        'id', entity_id,
        'table', TG_TABLE_SCHEMA || '.' || TG_TABLE_NAME,
        'event_type', TG_OP
    );
    
    -- Envia para o canal de sincronização
    PERFORM pg_notify('sync_channel', payload::text);
    
    IF (TG_OP = 'DELETE') THEN
        RETURN OLD;
    ELSE
        RETURN NEW;
    END IF;
END;
$$;


